import React from 'react';
import styled from 'styled-components';


const NavClient = styled.nav`
    width: 10vw;
    height: 100vh;
    content: '';
    display: flex;
    flex-direction: column;
`;

export default function NavBar() {
    return (
        <NavClient>
            <img src='/navbackground.png' alt='nav'></img>

        </NavClient>
    )
}
